import{_ as t}from"./chunks/overview.C-nKzmhM.js";import{_ as s,c as a,o,a4 as e}from"./chunks/framework.uQk9_EO2.js";const r="data:image/png;base64,",n="/docs/cocos/assets/lang-provider.Qdyim9tp.png",l="data:image/png;base64,",p="/docs/cocos/assets/complement.CYFroc4T.png",A="/docs/cocos/assets/new-key.BEeknN2U.png",g="/docs/cocos/assets/unfilled.YF6Ca6Z5.png",c="/docs/cocos/assets/other.KEFmAgSd.png",i="/docs/cocos/assets/translate.BwyCptq6.png",h="/docs/cocos/assets/translate-overview.DOtNbhvN.png",m="/docs/cocos/assets/translate-complete.DD2_73Ah.png",d="/docs/cocos/assets/translated-variant.BgMNWNjw.png",q="/docs/cocos/assets/preview-overview.BtSPaDEv.png",u="/docs/cocos/assets/original-preview.CnDBm67e.png",b="/docs/cocos/assets/translate-preview.B3WDNx9P.png",f="/docs/cocos/assets/export.kl2NpMPy.png",D="/docs/cocos/assets/delete.CVtqPFPw.png",P="/docs/cocos/assets/import-image.BI0gUu-M.png",w="/docs/cocos/assets/asset.CeP8XDLF.png",B="/docs/cocos/assets/import-other-lang-jpg.BRwRMOAZ.png",V="/docs/cocos/assets/source-matching.B0mPXjlL.png",S="/docs/cocos/assets/before-matching.CXXaoAGk.png",N="/docs/cocos/assets/matching-result.BqSkHny_.png",k="data:image/png;base64,",K="/docs/cocos/assets/import-csv.Czclf09g.png",L="/docs/cocos/assets/conflict.DdtBhy1z.png",Y=JSON.parse('{"title":"语言编译","description":"","frontmatter":{},"headers":[],"relativePath":"zh/editor/l10n/compile-language.md","filePath":"zh/editor/l10n/compile-language.md","lastUpdated":1712305443000}'),v={name:"zh/editor/l10n/compile-language.md"},O=e('<h1 id="语言编译" tabindex="-1">语言编译 <a class="header-anchor" href="#语言编译" aria-label="Permalink to &quot;语言编译&quot;">​</a></h1><p><img src="'+t+'" alt="overview"></p><p>当在 <a href="./collect-and-count">收集并统计</a> 视图中选定本地开发语言后，即可对编译过程进行配置。这里将包含 <strong>自动翻译</strong>、<strong>手动翻译</strong> 以及 <strong>变体</strong> 等功能。</p><h2 id="语言" tabindex="-1">语言 <a class="header-anchor" href="#语言" aria-label="Permalink to &quot;语言&quot;">​</a></h2><p>开发者可以在此处选择目标版本的语言。</p><p><img src="'+r+'" alt="add"></p><p>第一行的语言为 <strong>本地开发语言</strong>，记录当前开发过程中所使用的本地语言，通常可以选择为开发者熟悉的语言。在该语言下，<strong>操作</strong> 栏中会出现 <strong>补全</strong> 功能，用于记录 Label 组件的原文，需搭配 <a href="./l10n-label">L10nLabel</a> 使用，在有键无值的情况下使用；或匹配非文本资源的多语言。详情请参考下文 <strong>补全</strong> 部分。</p><p>从第二行开始，则是目标国家/地区所使用的语言，开发者需至少选择一个目标国家/地区的语言，才会出现翻译选项。</p><h2 id="译文服务商识别的语言" tabindex="-1">译文服务商识别的语言 <a class="header-anchor" href="#译文服务商识别的语言" aria-label="Permalink to &quot;译文服务商识别的语言&quot;">​</a></h2><p><img src="'+n+'" alt="provider"></p><p>上图用于在自动翻译时选择译文服务商的输入/输出的语言类型：</p><ul><li><p>对于本地开发语言，选择的是输入语言类型。</p></li><li><p>对于译文语言来说，选择的是输出语言类型。</p></li></ul><p>例如上图中，本地开发语言为英语（en），那么下拉菜单需要选择 <strong>English</strong>。</p><p>而译文是 <strong>简体中文（zh-Hans-CN）</strong>，那么在下拉菜单中请选择 <strong>zh-CHS</strong>。</p><blockquote><p><strong>注意</strong>：如果下拉菜单不可用，请检查 <a href="./translation-service">AppKey/AppSecret</a> 是否配置正确。</p></blockquote><h2 id="翻译进度" tabindex="-1">翻译进度 <a class="header-anchor" href="#翻译进度" aria-label="Permalink to &quot;翻译进度&quot;">​</a></h2><p><img src="'+l+'" alt="progress"></p><p>展示当前的翻译进度。</p><h2 id="操作" tabindex="-1">操作 <a class="header-anchor" href="#操作" aria-label="Permalink to &quot;操作&quot;">​</a></h2><p>操作栏内对本地开发语言提供了 <strong>补齐</strong> 功能，对于目标译文语言提供 <strong>翻译</strong> 功能。两者的通用功能包含 <strong>预览</strong>、<strong>导出</strong> 和 <strong>删除</strong>。</p><h3 id="补全" tabindex="-1">补全 <a class="header-anchor" href="#补全" aria-label="Permalink to &quot;补全&quot;">​</a></h3><p><strong>补全</strong> 供仅在当前语言设置为 <strong>本地开发语言</strong> 时生效。补齐功能的作用是记录当前开发语言中所要翻译的内容的原文。所有通过 <strong>搜集并统计</strong> 功能得到的原文数据将会在这里展示。点击后，可以查看所有的结果。</p><p><img src="'+p+'" alt="complemenet"></p><p>当在预制体或场景内通过 <a href="./l10n-label">L10nLabel</a> 组件添加键后：</p><p><img src="'+A+'" alt="new key"></p><p>可在 <strong>补全</strong> 界面中找到对应的键值，在 原文（Original） 一栏中输入该键对应的值，然后点击 <strong>保存</strong> 按钮即可将原文保存，如果 Label 的 String 属性有值，这里将被自动填充。</p><p><img src="'+g+'" alt="unfilled"></p><p>非本文内容如图片、音频等资源也进行补全，具体请参考下文 <strong>非文本资源</strong> 部分。</p><h3 id="变体" tabindex="-1">变体 <a class="header-anchor" href="#变体" aria-label="Permalink to &quot;变体&quot;">​</a></h3><p>变体功能专门用于解决翻译时遇到的复数问题，系统会根据变体的规则自动调整翻译的内容，用户也可以自由设定变体的规则。</p><p>在 <strong>补全</strong> 界面中，点击 <strong>变体</strong> 按钮可以输入新的变体：</p><p><img src="'+c+'" alt="otehr"></p><p>在 <strong>补全</strong> 完成后，记得需要点击上方的 <strong>保存</strong> 按钮进行保存。</p><p>变体的数量和语种有关，属于国际规则的一种，感兴趣的用户可移步 <a href="https://cldr.unicode.org/" target="_blank" rel="noreferrer">https://cldr.unicode.org/</a> 进行查看。</p><p>详情可以查看 <a href="./l10n-label">L10nLabel 变体数量</a>。</p><h3 id="翻译" tabindex="-1">翻译 <a class="header-anchor" href="#翻译" aria-label="Permalink to &quot;翻译&quot;">​</a></h3><p>当在 <strong>补全</strong> 功能中，添加了键值和原文后，即可以使用译文服务商的翻译服务进行翻译，点击 <strong>翻译按钮</strong> 可弹出翻译界面：</p><p><img src="'+i+'" alt="translate"></p><p>点击右上方的 <strong>翻译</strong> 按钮，进行翻译：</p><p><img src="'+h+'" alt="translate-overview"></p><p>翻译完成后可在 <strong>翻译</strong> 分页内查看翻译结果：</p><p><img src="'+m+'" alt="complete"></p><p>对于已翻译的文本，也可以点击 <strong>变体</strong>，添加不同的翻译：</p><p><img src="'+d+'" alt="variant"></p><blockquote><p><strong>注意</strong>：该功能仅在译文服务商正确配置情况下生效。</p></blockquote><h3 id="预览" tabindex="-1">预览 <a class="header-anchor" href="#预览" aria-label="Permalink to &quot;预览&quot;">​</a></h3><p>点击预览可快速预览当前场景持有 <a href="./l10n-label">L10nLabel</a> 组件的节点/图片资源等在该语言下的展示情况:</p><p><img src="'+q+'" alt="preview"></p><p>预览翻译前：</p><p><img src="'+u+'" alt="pev"></p><p>翻译后：</p><p><img src="'+b+'" alt="prev"></p><h3 id="导出" tabindex="-1">导出 <a class="header-anchor" href="#导出" aria-label="Permalink to &quot;导出&quot;">​</a></h3><p>点击 <strong>导出</strong> 按钮可以将原文/译文导出为 PO 文件。</p><blockquote><p>PO 文件是软件开发中一种常见的基于文本对象的文件，通常用于记录界面翻译的结果。</p></blockquote><p><img src="'+f+'" alt="export"></p><p>以下是一些辅助翻译工具，开发者可根据需求自行选择：</p><ul><li>Manipulating PO Files</li><li>PO 格式编辑器 <a href="https://poedit.net/" target="_blank" rel="noreferrer">https://poedit.net/</a></li><li>PO 格式工具箱 <a href="https://github.com/translate/translate" target="_blank" rel="noreferrer">https://github.com/translate/translate</a></li><li>离线 translation memory 工具 <a href="https://omegat.org/" target="_blank" rel="noreferrer">OmegaT - The Free Translation Memory Tool - OmegaT 3</a></li></ul><h3 id="删除" tabindex="-1">删除 <a class="header-anchor" href="#删除" aria-label="Permalink to &quot;删除&quot;">​</a></h3><p><img src="'+D+'" alt="del"></p><p>删除当前语言已翻译的进度，确认后结果不会被保存，请谨慎操作。本地开发语言不可删除。</p><h2 id="非文本资源" tabindex="-1">非文本资源 <a class="header-anchor" href="#非文本资源" aria-label="Permalink to &quot;非文本资源&quot;">​</a></h2><p>当项目中存在画在图片上的文字、不同语种配音的视频和音频时，也可能有本地化的需求。此时翻译界面会提供 <strong>导入</strong> 按钮，此处以图片为示例，展示如何配置本地化：</p><p><img src="'+P+'" alt="image"></p><p>当 <strong>收集和统计</strong> 完成后，被检测出的资源将会以路径作为键值的形式存在。</p><p><img src="'+w+'" alt="assets"></p><p>通过点击 <strong>导入</strong> 按钮，导入目标语言所需的图片即可：</p><p><img src="'+B+'" alt="dest image"></p><blockquote><p><strong>注意</strong>：</p><ol><li>导入时，只可导入项目内的文件。</li><li>由于自动合图会修改资源的 uuid 会导致重定向失败，致使需要翻译的图片不能勾选自动合图功能</li></ol></blockquote><h3 id="智能匹配" tabindex="-1">智能匹配 <a class="header-anchor" href="#智能匹配" aria-label="Permalink to &quot;智能匹配&quot;">​</a></h3><p>智能匹配按钮会弹出二级确认菜单，点击确认后将会开启智能匹配。智能匹配会通过文件路径或文件名来进行修改并匹配对应的语言。例如：</p><p>源文文件为: assets/aassb/cn-abc001.jpg，需将其翻译为英语，其译文文件为：assets/aassb/en-abc001.jpg，我们将自动把 assets/aassb/cn-abc001.jpg 中的 cn 替换为 en。</p><p>操作步骤：</p><ul><li><p>例如当我们本地开发语言为中文（zh）而需要翻译的语言为英语（en），此时可能会准备如下图中的资源：</p><p><img src="'+V+'" alt="source"></p></li><li><p>点击 <strong>智能匹配</strong> 后，在弹出的二级菜单内选择确认：</p><p><img src="'+S+'" alt="before"></p></li><li><p>开发者无需手动添加，不同语言的 role.jpg 将会被自动匹配：</p><p><img src="'+N+'" alt="result"></p></li></ul><h2 id="导入文件" tabindex="-1">导入文件 <a class="header-anchor" href="#导入文件" aria-label="Permalink to &quot;导入文件&quot;">​</a></h2><p>通过 <strong>导入文件</strong> 按钮可以将外部数据文件进行导入，支持 PO、CSV 以及 XLSX 格式。</p><p>对于 CSV 和 XLSX 的格式要求如下图：</p><p><img src="'+k+'" alt="xlsx"></p><p>文件需采用 UTF-8 编码格式。</p><p><img src="'+K+'" alt="csv"></p><p>导入后，如需手动翻译，其流程和上述文档一致。</p><p>详细的导入示例请参考 <a href="./example-excel">示例</a>。</p><h3 id="冲突解决" tabindex="-1">冲突解决 <a class="header-anchor" href="#冲突解决" aria-label="Permalink to &quot;冲突解决&quot;">​</a></h3><p>如重复导入同一个外部文件，会出现冲突的情况，此时需要手动解决冲突：</p><p><img src="'+L+'" alt="conflict"></p><ul><li><strong>跳过</strong>：跳过冲突的键值，不做额外的处理。</li><li><strong>覆盖</strong>：覆盖已有的键值，旧的数据会被丢弃。</li></ul>',86),y=[O];function H(x,Z,C,G,R,Q){return o(),a("div",null,y)}const M=s(v,[["render",H]]);export{Y as __pageData,M as default};
